var title_f13_11_13499="Estimation creatinine clearance";
var content_f13_11_13499=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F57378&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F57378&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=7\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Estimation of creatinine clearance in children",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Age, years",
"      </td>",
"      <td class=\"subtitle1\">",
"       K",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Low birth weight &le;1 year",
"      </td>",
"      <td>",
"       0.33",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Full-term &le;1 year",
"      </td>",
"      <td>",
"       0.45",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       2-12",
"      </td>",
"      <td>",
"       0.55",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       13-21 female",
"      </td>",
"      <td>",
"       0.55",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       13-21 male",
"      </td>",
"      <td>",
"       0.70",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    Creatinine clearance = (K x length (cm)) &divide; serum creatinine (mg/dL).",
"    <div class=\"footnotes\">",
"     Where:",
"     <br>",
"      - Creatinine clearance = creatinine clearance in mL/minute/1.73 m",
"      <sup>",
"       2",
"      </sup>",
"      .",
"      <br>",
"       - K = constant of proportionality that is age specific (see above).",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Schwartz GJ, Brion LP, Spitzer A. The use of plasma creatinine concentration for estimating glomerular filtration rate in infants, children, and adolescents. Ped Clin N Amer 1987; 34:571.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
