var title_f13_11_13500="Types allergic reactions SS";
var content_f13_11_13500=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PULM%2F80466&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PULM%2F80466&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Gell and Coombs classification of immunologic reactions",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Type",
"      </td>",
"      <td class=\"subtitle1\">",
"       Description",
"      </td>",
"      <td class=\"subtitle1\">",
"       Mechanism",
"      </td>",
"      <td class=\"subtitle1\">",
"       Clinical features",
"      </td>",
"     </tr>",
"     <tr>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        I",
"       </p>",
"       <p>",
"        Immediate reaction (within 1 hour)",
"       </p>",
"      </td>",
"      <td>",
"       IgE-mediated, immediate-type hypersensitivity",
"      </td>",
"      <td>",
"       Antigen exposure causes IgE-mediated activation of mast cells and basophils, with release of vasoactive substances such as histamine, prostaglandins, and leukotrienes.",
"      </td>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        Anaphylaxis",
"       </p>",
"       <p>",
"        Angioedema",
"       </p>",
"       <p>",
"        Bronchospasm",
"       </p>",
"       <p>",
"        Urticaria (hives)",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       II",
"      </td>",
"      <td>",
"       Antibody-dependent cytotoxicity",
"      </td>",
"      <td>",
"       An antigen or hapten that is intimately associated with a cell binds to antibody, leading to cell or tissue injury",
"      </td>",
"      <td colspan=\"1\" rowspan=\"1\">",
"       <p>",
"        Hemolytic anemia",
"       </p>",
"       <p>",
"        Thrombocytopenia",
"       </p>",
"       <p>",
"        Neutropenia",
"       </p>",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       III",
"      </td>",
"      <td>",
"       Immune complex disease",
"      </td>",
"      <td>",
"       Damage is caused by formation or deposition of antigen-antibody complexes in vessels or tissue. Deposition of immune complexes causes complement activation and/or recruitment of neutrophils by interaction of immune complexes with Fc IgG receptors",
"      </td>",
"      <td>",
"       Serum sickness",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       IV",
"      </td>",
"      <td>",
"       Cell-mediated or delayed hypersensitivity",
"      </td>",
"      <td>",
"       Antigen exposure activates T cells, which then mediate tissue injury. Depending upon the type of T cell activation and the other effector cells recruited, different subtypes can be differentiated (ie, Types IVa-IVd)",
"      </td>",
"      <td>",
"       Contact dermatitis, some morbilliform reactions, severe exfoliative dermatoses (eg, SJS/TEN), AGEP, DRESS/DiHS, interstitial nephritis, drug-induced hepatitis, other presentations",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    SJS/TEN: Stevens-Johnson syndrome/ Toxic epidermal necrolysis",
"    <br>",
"     AGEP: Acute generalized exanthematous pustulosis",
"     <br>",
"      DRESS/DiHS: Drug rash with eosinophilia and systemic symptoms/Drug-induced hypersensitivity syndrome",
"      <div class=\"footnotes\">",
"      </div>",
"      <div class=\"reference\">",
"       Adapted from: Weiss ME, Adkinson NF. Immediate hypersensitivity reactions to penicillin and related antibiotics. Clin Allergy 1988; 18:515.",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
